        target[field] = {};
      }

      fieldList = fieldList.concat(assign(target[field], value, fieldPath));
    } else {
      target[field] = value;
    }
  }

  return fieldList;
}

function assignRecursively(target, ...sources) {
  for (let source of sources) {
    assign(target, source);
  }

  return target;
}

